    post: {
      type : 'css',
      Date : Date.now(),
      title : 'useState 사용법',
      content : '하지만 간혹, 이 setState가 state를 변경시킨다고 오해하시는 분들이 있는거 같아서 이 글을 작성하게 되었습니다'
    }
  })
  
  
  

  return (
    <div className='posts'>
      <div className='postHeader'>
        <h1>Posts</h1>
        <span>포스팅 전체보기</span>
        <span>포스팅 주제별</span>
      </div>
      <div className='postList'>
        
      </div>
    </div>
    
  )
}

export default Posts
